import React, { Component } from 'react';
import { Route,HashRouter as Router,Link,Switch} from 'react-router-dom';
import styled from 'styled-components';

const Header = styled.div`
  overflow: hidden;
  background-color: #ffffff;
  padding: 15px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  & a{
    float: right;
    font-size: 16px;
    color: black;
    text-align: center;
    padding: 14px 16px;
    text-decoration: none;
  }


`;
const Dropdown_Content = styled.div`
display: none;
position: absolute;
background-color: #f9f9f9;
min-width: 160px;
box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
z-index: 1;

& a{
  float: none;
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  display: block;
  text-align: left;
}

&:hover {
  background-color: #ddd;
  display:block;
}
`;

const Dropdown = styled.div`
    float: right;
    overflow: hidden;
    &:hover ${Dropdown_Content} {
      display: block;
      text-decoration: none;

`;
const Dropbtn = styled.button`
    font-size: 16px;  
    border: none;
    outline: none;
    color: black;
    padding: 14px 16px;
    background-color: #ffffff;
    font-family: inherit;
    margin: 0;
`;



class Dashboard extends Component {
  
  constructor(props) {
   
    super(props);
    this.state = {
        company_id:''
    }

    this.logout=this.logout.bind(this);
  }
  logout(){
    sessionStorage.removeItem('formData');
    localStorage.removeItem('formData');
    this.props.history.push("/");
  }

  render() {
   
    const sessionData = localStorage.getItem('formData');
    const Data =  sessionStorage.getItem('formData.data.data.msgcode');
    
    const AllFormData = JSON.parse(sessionData);

    return (
     
      <div className="main_dashboard">
      
            
         <Router basename='/'>
           <div>
           <Header>
                <a href="#home">Home</a>
                <a href="#news">News</a>
                <Dropdown>
                  <Dropbtn>Dropdown 
                    <i class="fa fa-caret-down"></i>
                  </Dropbtn>
                  <Dropdown_Content>
                    <a href="#">Link 1</a>
                    <a href="#">Link 2</a>
                    <a href="#">Link 3</a>
                  </Dropdown_Content>
                </Dropdown> 
              </Header>

           </div> 
         </Router>
        </div>  
        

     
    );
  }
 
}
 
export default Dashboard;
